import {user} from './user.model';
import {Cours} from './cours.model';

export interface Reservation {
  idR: number;
  dateR: Date;
  statusR: Etat;
  professeur: user;
  etudiant: user;
  cours: Cours;
}
export enum Etat {
  Confirmé = 'Confirmé',
  En_attente= 'En_attente',
  Annulé= 'Annulé'
}
